const main=async()=>{const a=await ethers.getContractFactory("NFT"),t=await a.deploy();await t.deployed();const e=await t.address,o=await ethers.getContractFactory("AuctionManager"),c=await o.deploy();await c.deployed();const s=await c.address;console.log(`NFT deployed to: ${e}`),console.log(`Auction Manager deployed to: ${s}`)};main().then((()=>process.exit(0))).catch((a=>{console.error(a),process.exit(1)}));